swift -e '
import Carbon
let conditions = CFArrayCreateMutable(nil, 0, &kCFTypeArrayCallBacks)!
CFArrayAppendValue(conditions, CFDictionaryCreate(nil, nil, nil, 0, nil, nil))
if let sources = TISCreateInputSourceList(conditions, true)?.takeRetainedValue() as? [TISInputSource] {
    for source in sources {
        let id = Unmanaged<CFString>.fromOpaque(TISGetInputSourceProperty(source, kTISPropertyInputSourceID)!).takeUnretainedValue() as String
        let category = Unmanaged<CFString>.fromOpaque(TISGetInputSourceProperty(source, kTISPropertyInputSourceCategory)!).takeUnretainedValue() as String
        if id.contains("azoo") || id.contains("ensan") {
            let enabled = Unmanaged<CFBoolean>.fromOpaque(TISGetInputSourceProperty(source, kTISPropertyInputSourceIsEnabled)!).takeUnretainedValue()
            let selected = Unmanaged<CFBoolean>.fromOpaque(TISGetInputSourceProperty(source, kTISPropertyInputSourceIsSelected)!).takeUnretainedValue()
            print("\(id) | category: \(category) | enabled: \(CFBooleanGetValue(enabled)) | selected: \(CFBooleanGetValue(selected))")
        }
    }
}
